export function HalfStarIcon({
  percentage,
  ...rest
}: IconProps & { percentage: number }) {
  const fillPercentage = Math.min(Math.max(percentage, 0), 100);
  const pathData =
    "M20.924 7.625a1.523 1.523 0 0 0-1.238-1.044l-5.051-.734-2.259-4.577a1.534 1.534 0 0 0-2.752 0L7.365 5.847l-5.051.734A1.535 1.535 0 0 0 1.463 9.2l3.656 3.563-.863 5.031a1.532 1.532 0 0 0 2.226 1.616L11 17.033l4.518 2.375a1.534 1.534 0 0 0 2.226-1.617l-.863-5.03L20.537 9.2a1.523 1.523 0 0 0 .387-1.575Z";
  return (
    <Icon {...rest} fill="currentColor" viewBox="0 0 22 20">
      <defs>
        <mask id="mask">
          <path d={pathData} fill="white" />
        </mask>
      </defs>
      <path
        d={pathData}
        fill="currentColor"
        mask={`url(#mask)`}
        style={{ maskSize: "100% 100%", WebkitMaskSize: "100% 100%" }}
      />
      <path
        d={pathData}
        fill="red"
        mask={`url(#mask)`}
        style={{
          maskSize: "100% 100%",
          WebkitMaskSize: "100% 100%",
          maskPosition: `calc(${fillPercentage}% 0) 0`,
          WebkitMaskPosition: `calc(${fillPercentage}% 0) 0`,
        }}
      />
    </Icon>
  );
}

